var wordAmtInput, phraseBox, favBox, words;


function getphrase()
{
	var wordamt = wordAmtInput.value;
	var newphrase = [];
	for (var i = wordAmtInput.value - 1; i >= 0; i--)
	{
		if (wordAmtInput.value > 2 && i == wordAmtInput.value - 1)
		{
			newphrase.push(words[1][Math.floor(Math.random() * words[1].length)]);
		}
		else if(wordAmtInput.value > 2 && i == wordAmtInput.value - 2)
		{
			newphrase.push(words[2][Math.floor(Math.random() * words[2].length)]);
		}
		else if (wordAmtInput.value > 1 && i == wordAmtInput.value - 1)
		{
			newphrase.push(words[2][Math.floor(Math.random() * words[2].length)]);
		}
		else
		{
			newphrase.push(words[0][Math.floor(Math.random() * words[0].length)]);
		}
	}
	phraseBox.insertAdjacentHTML('afterbegin', '<span onclick="addfavphrase(this.innerHTML)">' + newphrase.join(' ') + '</span>');
	phraseBox.scrollTop = 0;
}


function addfavphrase(phrase)
{
	favBox.insertAdjacentHTML('afterbegin', '<span onclick="removefavphrase(this)">' + phrase + '</span>');
	favBox.scrollTop = 0;
}


function removefavphrase(phrase)
{
	phrase.parentElement.removeChild(phrase);
}


